import React from 'react'

function Table({states: distInfo}) {
    return (
        <div className="table">
          {
               distInfo==null ? <tr>
              <td>null</td>
            <td><strong>null</strong></td>
          </tr> :
               distInfo.map(state=> (
            <tr>
                <td>{state.name}</td>
              <td><strong>{state.confirmed}</strong></td>
            </tr>
              ))
          }

        </div>
    )
}

export default Table
